// SPDX-License-Identifier: GPL-3.0

pragma solidity ^0.8.4;

 contract counterContract {

     uint public counter;

     constructor() {
         counter = 0;
     }

     function incCounter() public {

         counter++;
     }

     function decCounter() public {

         require(counter!= 0,"Cannot decrement further");
         counter--;
     }

 }

